#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include <png.h>
#include <stddef.h>
#include <stdint.h>
#include <stdio.h>
#include <stdlib.h>

#include "GString.h"
#include "GlobalParams.h"
#include "JBIG2Stream.h"
#include "Object.h"
#include "PDFDoc.h"
#include "Splash.h"
#include "SplashBitmap.h"
#include "SplashOutputDev.h"
#include "Stream.h"
#include "config.h"
#include "gfile.h"
#include "gmem.h"
#include "gmempp.h"
#include "parseargs.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  int firstPage = fdp.ConsumeIntegral<int>();
  int lastPage = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *stream = new MemStream(payload.data(),  0, payload.size(), &obj);

  PDFDoc *doc;
  try {
    doc = new PDFDoc(stream);
    OutputDev *output_dev = nullptr;
    if (doc->isOk()) {
      doc->displayPages(output_dev, firstPage, lastPage, hDPI, vDPI, rotate, useMediaBox, crop, printing, NULL, NULL);
    }
  } catch (...) { }

  delete doc;

  return 0;
}

#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <string.h>
#include <vector>

#include "Object.h"
#include "Stream.h"
#include "Dict.h"
#include "OutputDev.h"
#include "PDFDoc.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);
  int firstPage = fdp.ConsumeIntegral<int>();
  int lastPage = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeIntegral<GBool>();
  GBool crop = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *stream = new MemStream(payload.data(),  0, payload.size(), &obj);

  PDFDoc *doc = NULL;
  try {
    PDFDoc doc(stream);
    if (doc.isOk() == gTrue) {
      OutputDev *output_dev = nullptr;
      doc.displayPages(output_dev, firstPage, lastPage, hDPI, vDPI, rotate, useMediaBox, crop, printing, NULL, NULL);
    }
  } catch (...) {
  }
  return 0;
}
